import React from 'react'

export default function RowFavoritesTable(props) {
    return (
        <tr>
             <td>{props.item.PLAYER_NAME}</td>
             <td>{props.item.TEAM_ABBREVIATION}</td>
             <td>{props.item.PTS}</td>
        </tr>
    )
}
